chrome.storage.sync.get(['webhookUrl', 'username', 'uid'], function(data) {
	const webhookUrl = data.webhookUrl;
	const username = data.username;
	const uid = data.uid;
	console.log(`Stored Webhook URL: ${webhookUrl}`);
	console.log(`Stored Username: ${username}`);
	console.log(`Stored UID: ${uid}`);

	if (webhookUrl && username) {

		const img = new Image();
		img.onload = () => {
			const canvas = document.createElement('canvas');
			const ctx = canvas.getContext('2d');
			canvas.width = img.width;
			canvas.height = img.height;
			
			ctx.drawImage(img, 0, 0);
			ctx.font = '96px Arial'
			ctx.fillStyle = 'black';
			ctx.textAlign = 'center';
			ctx.fillText(username + "'s dumb", img.width/2, img.height/2 - 96 * 3);
			ctx.fillText("ass is trying to", img.width/2, img.height/2 - 96 * 2);
			ctx.fillText("watch youtube", img.width/2, img.height/2 - 96);
			ctx.fillText('laugh at this loser', img.width/2, img.height/2 + 96*3 + 48);

			canvas.toBlob((blob) => {
				const formData = new FormData();
				formData.append('file', blob, 'image.png');
				formData.append('payload_json', JSON.stringify({
					username: "No YouTube",
					avatar_url: "",
					content: uid ? `<@${uid}>` : ''
				}));

				// fire and forget üòÅ
				fetch(webhookUrl, {
					method: 'POST',
					body: formData,
				})
			}, 'image/jpeg', 1);
		}
		img.src = "data:image/jpeg;base64,"
	}
})
